description:
Grateful Dead
December 17, 1992
Oakland Arena in 
Oakland, CA

SBD + AUD Matrix 4 Source Mix
(60%-SBD/40%-AUD)


***Set 1***
s1t01 - Touch of Grey
s1t02 - Walkin Blues
