s1t04 - Queen Jane Approximately
s1t05 - So Many Roads
s1t06 - Music Never Stopped

***Set 2***
s2t01 - Scarlet Begonias &gt;
s2t02 - Fire on the Mountain
s2t03 - Long Way to go Home
s2t04 - Corinna &gt;
s2t05 - Uncle John's Band &gt;
s2t06 - Playin' In the Band reprise &gt;
s2t07 - Drums &gt;
s2t08 - Space &gt;
s2t09 - The Last Time &gt;
s2t10 - Here Comes Sunshine &gt;
s2t11 - Throwing Stones &gt;
s2t12 - Not Fade Away

***Encore***
s3t01 - Baba O'Reilly &gt;
d3t02 - Tomorrow Never Knows


